import React from "react";

const Contact = () => {

    return (
      <>
      <div className="my3">
        <h1 className="text-center">Contact Us</h1>
      </div>
      <div className="container">
        <div className="row">
          <div className="col-md-6 col-10 mx-auto"></div>
        </div>
      </div>
    
      </>
    )
  }
  export default Contact;
